	<text transform="matrix(1 0 0 0.94 477.6387 2108.7173)" fill="#B9AAA2" font-family="'Source Sans Pro'" font-weight="700" font-size="10">Footnotes:</text>
	
		<text transform="matrix(0.583 0 0 0.548 477.6387 2120.6177)" fill="#B9AAA2" font-family="'Source Sans Pro'" font-size="10">1</text>
	<text transform="matrix(1 0 0 0.94 480.5361 2123.7476)" fill="#B9AAA2" font-family="'Source Sans Pro'" font-size="10"> Based on an average of two walk leaders per walk. </text>
	
		<text transform="matrix(0.583 0 0 0.548 477.6387 2135.6479)" fill="#B9AAA2" font-family="'Source Sans Pro'" font-size="10">2</text>
	<text transform="matrix(1 0 0 0.94 480.5361 2138.7778)" fill="#B9AAA2" font-family="'Source Sans Pro'" font-size="10"> Historically, 30-40% of all Walk Leaders have met these criteria. We will promote our workshops to </text>
	<text transform="matrix(1 0 0 0.94 477.6387 2153.8081)" fill="#B9AAA2" font-family="'Source Sans Pro'" font-size="10">everyone, with guidelines around eligibility, and target 20% total trained per year (100 people). </text>
	
		<text transform="matrix(0.583 0 0 0.548 477.6387 2165.7085)" fill="#B9AAA2" font-family="'Source Sans Pro'" font-size="10">3</text>
	<text transform="matrix(1 0 0 0.94 480.5361 2168.8384)" fill="#B9AAA2" font-family="'Source Sans Pro'" font-size="10"> The criteria for this will need to be futher refined, but all returning City Ogranizers will have an </text>
	<text transform="matrix(1 0 0 0.94 477.6387 2183.8687)" fill="#B9AAA2" font-family="'Source Sans Pro'" font-size="10">opportunity to apply for training and funding, with 10% (10 City Organizers) selected per year.</text>
	
		<text transform="matrix(0.583 0 0 0.548 477.6387 2195.769)" fill="#B9AAA2" font-family="'Source Sans Pro'" font-size="10">4</text>
	<text transform="matrix(1 0 0 0.94 480.5361 2198.8989)" fill="#B9AAA2" font-family="'Source Sans Pro'" font-size="10"> We will develop a method of documentation that shares key indicators in a way that allows for </text>
	<text transform="matrix(1 0 0 0.94 477.6387 2213.9292)" fill="#B9AAA2" font-family="'Source Sans Pro'" font-size="10">comparisons across cities, beyond our existing qualitative methods.</text>
